=head1 DESCRIPTION

High-level information for a firewall rule group. A firewall rule group
is a collection of rules that DNS Firewall uses to filter DNS network
traffic for a VPC. To retrieve the rules for the rule group, call
ListFirewallRules.

=head1 ATTRIBUTES


=head2 Arn => Str

The ARN (Amazon Resource Name) of the rule group.


=head2 CreationTime => Str

The date and time that the rule group was created, in Unix time format
and Coordinated Universal Time (UTC).


=head2 CreatorRequestId => Str

A unique string defined by you to identify the request. This allows you
to retry failed requests without the risk of executing the operation
twice. This can be any unique string, for example, a timestamp.


=head2 Id => Str

The ID of the rule group.


=head2 ModificationTime => Str

The date and time that the rule group was last modified, in Unix time
format and Coordinated Universal Time (UTC).


=head2 Name => Str

The name of the rule group.


=head2 OwnerId => Str

The AWS account ID for the account that created the rule group. When a
rule group is shared with your account, this is the account that has
shared the rule group with you.


=head2 RuleCount => Int

The number of rules in the rule group.


=head2 ShareStatus => Str

Whether the rule group is shared with other AWS accounts, or was shared
with the current account by another AWS account. Sharing is configured
through AWS Resource Access Manager (AWS RAM).


=head2 Status => Str

The status of the domain list.


=head2 StatusMessage => Str

Additional information about the status of the rule group, if
available.



